import React from 'react';
import Container from '../components/container';
import Text from '../components/text';

const dummyPhoto = {
    photo_01:"data:image/jpeg;base64,",
    photo_02:"data:image/jpeg;base64,",
    photo_03:"data:image/jpeg;base64,",
    photo_04:"data:image/jpeg;base64,"
}

const Home = () => {
  return (
    <Container>
      <Text fontSize='mainTitle'>하루 그림</Text>
      <Text>당신의 그림습관</Text>
      <Text style={{margin:"100px"}} fontSize='massive'>"스케치북"</Text>
      <Text>오늘의 그림들</Text>
      <Container></Container>
    </Container>
  );
};

export default Home;
